// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "./SystemInterfaces.sol";

/**
 * @title CreatorTokenManager
 * @author Quantum Development Team
 * @notice Controls creator tokens on the Quantum Platform
 */
contract CreatorTokenManager {
    int constant OPERATION_SUCCESS = 22;
    uint256 public constant CREATOR_FEE_BPS = 500;

    struct CreatorTokenInfo {
        address tokenContract;
        uint256 totalSupply;
        uint256 tokenPrice;
        uint256 launchDate;
    }

    IQuantumPlatformCore public platformCore;
    mapping(address => address) private creatorTokenContracts;
    mapping(address => CreatorTokenInfo) private creatorTokenInfo;

    event CreatorTokenDeployed(address indexed creator, address indexed tokenContract, uint256 totalSupply, uint256 tokenPrice);
    event CreatorTokenPurchased(address indexed buyer, address indexed creator, uint256 baseTokenSpent, uint256 tokensReceived);

    modifier systemActive() {
        require(platformCore.isSystemActive(), "CreatorTokenManager: system is not active");
        _;
    }

    modifier tokenExists(address creator) {
        require(creatorTokenContracts[creator] != address(0), "CreatorTokenManager: creator token not found");
        _;
    }

    constructor(address _platformCore) {
        require(_platformCore != address(0), "CreatorTokenManager: platform core address is zero");
        platformCore = IQuantumPlatformCore(_platformCore);
    }

    function deployCreatorToken(address tokenContract, uint256 totalSupply, uint256 tokenPrice) external systemActive {
        require(tokenContract != address(0), "CreatorTokenManager: invalid token contract");
        require(creatorTokenContracts[msg.sender] == address(0), "CreatorTokenManager: creator already has token");
        require(totalSupply > 0 && tokenPrice > 0, "CreatorTokenManager: invalid parameters");

        creatorTokenContracts[msg.sender] = tokenContract;
        creatorTokenInfo[msg.sender] = CreatorTokenInfo({
            tokenContract: tokenContract,
            totalSupply: totalSupply,
            tokenPrice: tokenPrice,
            launchDate: block.timestamp
        });

        emit CreatorTokenDeployed(msg.sender, tokenContract, totalSupply, tokenPrice);
    }

    function buyCreatorToken(address creator, uint256 baseTokenAmount) external systemActive tokenExists(creator) returns (uint256) {
        require(baseTokenAmount > 0, "CreatorTokenManager: amount must be greater than zero");
        require(platformCore.checkTransactionLimits(msg.sender, baseTokenAmount), "CreatorTokenManager: exceeds transaction limits");

        platformCore.updateTransactionRecord(msg.sender, baseTokenAmount);

        CreatorTokenInfo storage tokenInfo = creatorTokenInfo[creator];
        uint256 tokensReceived = (baseTokenAmount * 1e6) / tokenInfo.tokenPrice;
        require(tokensReceived > 0, "CreatorTokenManager: amount too small");

        uint256 creatorFee = (baseTokenAmount * CREATOR_FEE_BPS) / 10000;
        uint256 creatorPayment = baseTokenAmount - creatorFee;

        IHederaTokenService hederaInterface = platformCore.getHederaInterface();
        address baseToken = platformCore.getBaseToken();
        address treasury = platformCore.getTreasuryWallet();

        // Transfer base tokens from buyer
        int operationResult = hederaInterface.transferToken(baseToken, msg.sender, address(this), int64(uint64(baseTokenAmount)));
        require(operationResult == OPERATION_SUCCESS, "CreatorTokenManager: base token transfer failed");

        // Pay creator
        operationResult = hederaInterface.transferToken(baseToken, address(this), creator, int64(uint64(creatorPayment)));
        require(operationResult == OPERATION_SUCCESS, "CreatorTokenManager: creator payment failed");

        // Pay creator fee
        operationResult = hederaInterface.transferToken(baseToken, address(this), treasury, int64(uint64(creatorFee)));
        require(operationResult == OPERATION_SUCCESS, "CreatorTokenManager: fee payment failed");

        // Transfer creator tokens
        operationResult = hederaInterface.transferToken(tokenInfo.tokenContract, creator, msg.sender, int64(uint64(tokensReceived)));
        require(operationResult == OPERATION_SUCCESS, "CreatorTokenManager: creator token transfer failed");

        emit CreatorTokenPurchased(msg.sender, creator, baseTokenAmount, tokensReceived);
        return tokensReceived;
    }

    function getCreatorTokenContract(address creator) external view returns (address) {
        return creatorTokenContracts[creator];
    }

    function getCreatorTokenInfo(address creator) external view tokenExists(creator) returns (address, uint256, uint256, uint256) {
        CreatorTokenInfo storage tokenInfo = creatorTokenInfo[creator];
        return (tokenInfo.tokenContract, tokenInfo.totalSupply, tokenInfo.tokenPrice, tokenInfo.launchDate);
    }
}

contracts/ModuleDeployer.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "./ServiceManager.sol";
import "./AssetManager.sol";
import "./StakeManager.sol";
import "./CreatorTokenManager.sol";
import "./SecurityModule.sol";

/**
 * @title ModuleDeployer
 * @author Quantum Development Team
 * @notice Deployer for platform module contracts
 */
contract ModuleDeployer {
    event ModulesDeployed(
        address serviceManager,
        address assetManager,
        address stakeManager,
        address creatorTokenManager,
        address securityModule
    );

    function deployAllModules(address platformCore) external returns (
        address serviceManagerAddr,
        address assetManagerAddr,
        address stakeManagerAddr,
        address creatorTokenManagerAddr,
        address securityModuleAddr
    ) {
        require(platformCore != address(0), "ModuleDeployer: platform core address is zero");

        serviceManagerAddr = address(new ServiceManager(platformCore));
        assetManagerAddr = address(new AssetManager(platformCore));
        stakeManagerAddr = address(new StakeManager(platformCore));
        creatorTokenManagerAddr = address(new CreatorTokenManager(platformCore));
        securityModuleAddr = address(new SecurityModule(platformCore));

        emit ModulesDeployed(
            serviceManagerAddr,
            assetManagerAddr,
            stakeManagerAddr,
            creatorTokenManagerAddr,
            securityModuleAddr
        );

        return (
            serviceManagerAddr,
            assetManagerAddr,
            stakeManagerAddr,
            creatorTokenManagerAddr,
            securityModuleAddr
        );
    }
}

contracts/NexusEcosystemHub.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "./SystemInterfaces.sol";

/**
 * @title NexusEcosystemHub
 * @author Nexus Development Team
 * @notice Central hub contract for Nexus Ecosystem platform with unified state management
 */
contract NexusEcosystemHub is INexusEcosystemCore {
    address constant HEDERA_TOKEN_SERVICE = address(0x0000000000000000000167);
    int constant SUCCESS_CODE = 22;
    uint256 public constant TIMELOCK_PERIOD = 24 hours;

    address public platformOwner;
    address public reserveWallet;
    bool public systemPaused;
    address public primaryTokenAddress;
    address public secondaryTokenAddress;
    uint256 public baseExchangeRate = 100;
    uint256 public tokenExchangeRate = 500;
    uint256 public maxTransactionLimit = 10000 * 1e6;
    uint256 public dailyTransactionLimit = 100000 * 1e6;
    
    mapping(address => uint256) public dailyTransactionVolume;
    mapping(address => uint256) public lastTransactionDay;
    mapping(address => bool) public authorizedManagers;

    event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);
    event SystemPaused(address indexed initiator);
    event SystemResumed(address indexed initiator);

    modifier onlyOwner() {
        require(msg.sender == platformOwner, "NexusEcosystemHub: caller is not the owner");
        _;
    }

    modifier onlyAuthorized() {
        require(msg.sender == platformOwner || authorizedManagers[msg.sender], "NexusEcosystemHub: caller is not authorized");
        _;
    }

    modifier whenActive() {
        require(!systemPaused, "NexusEcosystemHub: system is paused");
        _;
    }

    constructor() {
        platformOwner = msg.sender;
        reserveWallet = msg.sender;
    }

    function isOwner(address userAccount) external view override returns (bool) {
        return userAccount == platformOwner;
    }

    function isManager(address userAccount) external view override returns (bool) {
        return userAccount == platformOwner || authorizedManagers[userAccount];
    }

    function isActive() external view override returns (bool) {
        return !systemPaused;
    }

    function getHederaService() external view override returns (IHederaTokenService) {
        return IHederaTokenService(HEDERA_TOKEN_SERVICE);
    }

    function getReserveWallet() external view override returns (address) {
        return reserveWallet;
    }

    function getPrimaryToken() external view override returns (address) {
        return primaryTokenAddress;
    }

    function getSecondaryToken() external view override returns (address) {
        return secondaryTokenAddress;
    }

    function getExchangeRate() external view override returns (uint256) {
        return tokenExchangeRate;
    }

    function validateTransactionLimits(address userAccount, uint256 transactionAmount) external override returns (bool) {
        if (transactionAmount > maxTransactionLimit) return false;
        
        uint256 currentDay = block.timestamp / 1 days;
        if (currentDay > lastTransactionDay[userAccount]) {
            lastTransactionDay[userAccount] = currentDay;
            dailyTransactionVolume[userAccount] = 0;
        }
        
        return dailyTransactionVolume[userAccount] + transactionAmount <= dailyTransactionLimit;
    }

    function recordTransaction(address userAccount, uint256 transactionAmount) external override {
        uint256 currentDay = block.timestamp / 1 days;
        if (currentDay > lastTransactionDay[userAccount]) {
            lastTransactionDay[userAccount] = currentDay;
            dailyTransactionVolume[userAccount] = 0;
        }
        dailyTransactionVolume[userAccount] += transactionAmount;
    }

    function transferOwnership(address newOwner) external onlyOwner {
        require(newOwner != address(0), "NexusEcosystemHub: new owner is the zero address");
        emit OwnershipTransferred(platformOwner, newOwner);
        platformOwner = newOwner;
    }

    function addManager(address managerAddress) external onlyOwner {
        require(managerAddress != address(0), "NexusEcosystemHub: manager is the zero address");
        authorizedManagers[managerAddress] = true;
    }

    function removeManager(address managerAddress) external onlyOwner {
        authorizedManagers[managerAddress] = false;
    }

    function configureTokens(address _primaryToken, address _secondaryToken) external onlyOwner {
        require(_primaryToken != address(0) && _secondaryToken != address(0), "Invalid token addresses");
        primaryTokenAddress = _primaryToken;
        secondaryTokenAddress = _secondaryToken;
    }

    function pauseSystem() external onlyOwner {
        systemPaused = true;
        emit SystemPaused(msg.sender);
    }

    function resumeSystem() external onlyOwner {
        systemPaused = false;
        emit SystemResumed(msg.sender);
    }
}

contracts/PlatformGateway.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "./SystemInterfaces.sol";

/**
 * @title PlatformGateway
 * @author Quantum Development Team
 * @notice Gateway contract for the Quantum Platform ecosystem
 */
contract PlatformGateway {
    bytes32 private constant CONTROLLER_SLOT = bytes32(uint256(keccak256('eip1967.gateway.controller')) - 1);

    IQuantumPlatformCore public platformCore;
    address public serviceManager;
    address public assetManager;
    address public stakeManager;
    address public creatorTokenManager;
    address public securityModule;

    event GatewayDeployed(address indexed platformCore);
    event ModulesLinked(address serviceManager, address assetManager, address stakeManager, address creatorTokenManager, address securityModule);

    constructor(address _platformCore) {
        require(_platformCore != address(0), "PlatformGateway: platform core address is zero");
        platformCore = IQuantumPlatformCore(_platformCore);
        _setController(msg.sender);
        emit GatewayDeployed(_platformCore);
    }

    modifier onlyController() {
        require(msg.sender == _getController(), "PlatformGateway: caller is not controller");
        _;
    }

    function linkModules(
        address _serviceManager,
        address _assetManager,
        address _stakeManager,
        address _creatorTokenManager,
        address _securityModule
    ) external onlyController {
        require(_serviceManager != address(0), "Invalid service manager");
        require(_assetManager != address(0), "Invalid asset manager");
        require(_stakeManager != address(0), "Invalid stake manager");
        require(_creatorTokenManager != address(0), "Invalid creator token manager");
        require(_securityModule != address(0), "Invalid security module");

        serviceManager = _serviceManager;
        assetManager = _assetManager;
        stakeManager = _stakeManager;
        creatorTokenManager = _creatorTokenManager;
        securityModule = _securityModule;

        emit ModulesLinked(_serviceManager, _assetManager, _stakeManager, _creatorTokenManager, _securityModule);
    }

    function changeController(address newController) external onlyController {
        require(newController != address(0), "PlatformGateway: invalid controller");
        _setController(newController);
    }

    function getController() external view returns (address) {
        return _getController();
    }

    // Platform Core proxy functions
    function changeOwner(address newOwner) external {
        require(msg.sender == _getController(), "Unauthorized");
        platformCore.changeOwner(newOwner);
    }

    function addSupervisor(address supervisor) external {
        require(msg.sender == _getController(), "Unauthorized");
        platformCore.addSupervisor(supervisor);
    }

    function emergencyStop() external {
        require(msg.sender == _getController(), "Unauthorized");
        platformCore.emergencyStop();
    }

    function emergencyResume() external {
        require(msg.sender == _getController(), "Unauthorized");
        platformCore.emergencyResume();
    }

    function _setController(address newController) private {
        bytes32 slot = CONTROLLER_SLOT;
        assembly {
            sstore(slot, newController)
        }
    }

    function _getController() private view returns (address controller) {
        bytes32 slot = CONTROLLER_SLOT;
        assembly {
            controller := sload(slot)
        }
    }
}

contracts/QuantumPlatformCore.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "./SystemInterfaces.sol";

/**
 * @title QuantumPlatformCore
 * @author Quantum Development Team
 * @notice Core contract for the Quantum Platform
 */
contract QuantumPlatformCore is IQuantumPlatformCore {
    address constant HEDERA_TOKEN_SERVICE = address(0x0000000000000000000167);
    
    address public platformOwner;
    address public treasuryWallet;
    address public baseTokenAddress;
    address public utilityTokenAddress;
    bool public systemActive;
    uint256 public maxTransactionAmount = 10000 * 1e6;
    uint256 public dailyTransactionCap = 100000 * 1e6;

    mapping(address => bool) public supervisors;
    mapping(address => uint256) public dailyTransactionTotals;
    mapping(address => uint256) public lastTransactionTimestamp;

    event OwnershipChanged(address indexed oldOwner, address indexed newOwner);
    event SystemStopped();
    event SystemStarted();

    modifier onlyOwner() {
        require(msg.sender == platformOwner, "QuantumPlatformCore: caller is not owner");
        _;
    }

    modifier onlySupervisor() {
        require(supervisors[msg.sender] || msg.sender == platformOwner, "QuantumPlatformCore: caller is not supervisor");
        _;
    }

    constructor() {
        platformOwner = msg.sender;
        treasuryWallet = msg.sender;
        systemActive = true;
    }

    function isOwner(address account) external view override returns (bool) {
        return account == platformOwner;
    }

    function isSupervisor(address account) external view override returns (bool) {
        return supervisors[account] || account == platformOwner;
    }

    function isSystemActive() external view override returns (bool) {
        return systemActive;
    }

    function getHederaInterface() external view override returns (IHederaTokenService) {
        return IHederaTokenService(HEDERA_TOKEN_SERVICE);
    }

    function getTreasuryWallet() external view override returns (address) {
        return treasuryWallet;
    }

    function getBaseToken() external view override returns (address) {
        return baseTokenAddress;
    }

    function getUtilityToken() external view override returns (address) {
        return utilityTokenAddress;
    }

    function checkTransactionLimits(address account, uint256 amount) external override returns (bool) {
        if (amount > maxTransactionAmount) return false;
        
        uint256 currentDay = block.timestamp / 1 days;
        if (currentDay > lastTransactionTimestamp[account]) {
            lastTransactionTimestamp[account] = currentDay;
            dailyTransactionTotals[account] = 0;
        }
        
        return dailyTransactionTotals[account] + amount <= dailyTransactionCap;
    }

    function updateTransactionRecord(address account, uint256 amount) external override {
        uint256 currentDay = block.timestamp / 1 days;
        if (currentDay > lastTransactionTimestamp[account]) {
            lastTransactionTimestamp[account] = currentDay;
            dailyTransactionTotals[account] = 0;
        }
        dailyTransactionTotals[account] += amount;
    }

    function changeOwner(address newOwner) external onlyOwner {
        require(newOwner != address(0), "Invalid owner address");
        emit OwnershipChanged(platformOwner, newOwner);
        platformOwner = newOwner;
    }

    function addSupervisor(address supervisor) external onlyOwner {
        require(supervisor != address(0), "Invalid supervisor address");
        supervisors[supervisor] = true;
    }

    function removeSupervisor(address supervisor) external onlyOwner {
        supervisors[supervisor] = false;
    }

    function setTokenAddresses(address _baseToken, address _utilityToken) external onlyOwner {
        require(_baseToken != address(0) && _utilityToken != address(0), "Invalid token addresses");
        baseTokenAddress = _baseToken;
        utilityTokenAddress = _utilityToken;
    }

    function emergencyStop() external override onlyOwner {
        systemActive = false;
        emit SystemStopped();
    }

    function emergencyResume() external override onlyOwner {
        systemActive = true;
        emit SystemStarted();
    }
}

contracts/SecurityManager.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "./SystemInterfaces.sol";

/**
 * @title SecurityManager
 * @author Nexus Development Team
 * @notice Controls security mechanisms for the Nexus Ecosystem platform
 */
contract SecurityManager {
    int constant OPERATION_SUCCESS = 22;

    INexusEcosystemCore public ecosystemCore;

    event SecurityIncident(address indexed reporter, string description);
    event AssetsRecovered(address indexed tokenAddress, uint256 amount);

    modifier onlyOwner() {
        require(ecosystemCore.isOwner(msg.sender), "SecurityManager: caller is not the owner");
        _;
    }

    modifier onlyAuthorized() {
        require(ecosystemCore.isManager(msg.sender), "SecurityManager: caller is not authorized");
        _;
    }

    constructor(address _ecosystemCore) {
        require(_ecosystemCore != address(0), "SecurityManager: ecosystem core address is zero");
        ecosystemCore = INexusEcosystemCore(_ecosystemCore);
    }

    function pauseSystem() external onlyOwner {
        ecosystemCore.pauseSystem();
    }

    function resumeSystem() external onlyOwner {
        ecosystemCore.resumeSystem();
    }

    function recoverAssets(address tokenAddress, uint256 recoveryAmount) external onlyOwner {
        require(recoveryAmount > 0, "SecurityManager: recovery amount must be greater than zero");
        
        IHederaTokenService hederaService = ecosystemCore.getHederaService();
        int operationResult = hederaService.transferToken(tokenAddress, address(this), msg.sender, int64(uint64(recoveryAmount)));
        require(operationResult == OPERATION_SUCCESS, "SecurityManager: asset recovery failed");
        
        emit AssetsRecovered(tokenAddress, recoveryAmount);
    }

    function reportIncident(string calldata description) external onlyAuthorized {
        emit SecurityIncident(msg.sender, description);
    }
}

