// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "./SystemInterfaces.sol";

/**
 * @title StakeManager
 * @author Quantum Development Team
 * @notice Handles staking transactions on the Quantum Platform
 */
contract StakeManager {
    int constant OPERATION_SUCCESS = 22;
    uint256 public constant STAKE_FEE_BPS = 200;

    IQuantumPlatformCore public platformCore;

    event TokensStaked(address indexed staker, uint256 baseTokenAmount, uint256 utilityTokenAmount);

    modifier systemActive() {
        require(platformCore.isSystemActive(), "StakeManager: system is not active");
        _;
    }

    constructor(address _platformCore) {
        require(_platformCore != address(0), "StakeManager: platform core address is zero");
        platformCore = IQuantumPlatformCore(_platformCore);
    }

    function stakeTokens(uint256 baseTokenAmount) external systemActive returns (uint256) {
        require(baseTokenAmount > 0, "StakeManager: amount must be greater than zero");
        require(platformCore.checkTransactionLimits(msg.sender, baseTokenAmount), "StakeManager: exceeds transaction limits");

        platformCore.updateTransactionRecord(msg.sender, baseTokenAmount);

        // Calculate utility tokens (1:500 ratio)
        uint256 utilityTokenAmount = (baseTokenAmount * 1e6) / 500;
        require(utilityTokenAmount > 0, "StakeManager: amount too small");

        uint256 stakeFee = (baseTokenAmount * STAKE_FEE_BPS) / 10000;
        uint256 tokensToStake = baseTokenAmount - stakeFee;

        IHederaTokenService hederaInterface = platformCore.getHederaInterface();
        address baseToken = platformCore.getBaseToken();
        address utilityToken = platformCore.getUtilityToken();
        address treasury = platformCore.getTreasuryWallet();

        // Transfer base tokens from staker
        int operationResult = hederaInterface.transferToken(baseToken, msg.sender, address(this), int64(uint64(baseTokenAmount)));
        require(operationResult == OPERATION_SUCCESS, "StakeManager: base token transfer failed");

        // Transfer stake fee to treasury
        operationResult = hederaInterface.transferToken(baseToken, address(this), treasury, int64(uint64(stakeFee)));
        require(operationResult == OPERATION_SUCCESS, "StakeManager: fee transfer failed");

        // Burn remaining base tokens
        operationResult = hederaInterface.wipeToken(baseToken, address(this), int64(uint64(tokensToStake)));
        require(operationResult == OPERATION_SUCCESS, "StakeManager: token burn failed");

        // Mint utility tokens
        bytes[] memory emptyMetadata = new bytes[](0);
        (operationResult, ) = hederaInterface.mintToken(utilityToken, int64(uint64(utilityTokenAmount)), emptyMetadata);
        require(operationResult == OPERATION_SUCCESS, "StakeManager: utility token mint failed");

        // Transfer utility tokens to staker
        operationResult = hederaInterface.transferToken(utilityToken, address(this), msg.sender, int64(uint64(utilityTokenAmount)));
        require(operationResult == OPERATION_SUCCESS, "StakeManager: utility token transfer failed");

        emit TokensStaked(msg.sender, baseTokenAmount, utilityTokenAmount);
        return utilityTokenAmount;
    }
}

contracts/SystemInterfaces.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

/**
 * @title IHederaTokenService
 * @notice Interface for the Hedera Token Service precompiled contract
 */
interface IHederaTokenService {
    function transferToken(address token, address sender, address receiver, int64 amount) external returns (int);
    function transferNFT(address token, address sender, address receiver, int64 serialNumber) external returns (int);
    function mintToken(address token, int64 amount, bytes[] memory metadata) external returns (int, int64[] memory);
    function wipeToken(address token, address from, int64 amount) external returns (int);
    function associateToken(address account, address token) external returns (int);
}

/**
 * @title INexusEcosystemCore
 * @notice Interface for core Nexus Ecosystem platform functions
 */
interface INexusEcosystemCore {
    function isOwner(address account) external view returns (bool);
    function isManager(address account) external view returns (bool);
    function isActive() external view returns (bool);
    function getHederaService() external view returns (IHederaTokenService);
    function getReserveWallet() external view returns (address);
    function getPrimaryToken() external view returns (address);
    function getSecondaryToken() external view returns (address);
    function getExchangeRate() external view returns (uint256);
    function validateTransactionLimits(address account, uint256 amount) external returns (bool);
    function recordTransaction(address account, uint256 amount) external;
    function pauseSystem() external;
    function resumeSystem() external;
}

/**
 * @title IQuantumPlatformCore
 * @notice Interface for core Quantum Platform functions
 */
interface IQuantumPlatformCore {
    function isOwner(address account) external view returns (bool);
    function isSupervisor(address account) external view returns (bool);
    function isSystemActive() external view returns (bool);
    function getHederaInterface() external view returns (IHederaTokenService);
    function getTreasuryWallet() external view returns (address);
    function getBaseToken() external view returns (address);
    function getUtilityToken() external view returns (address);
    function checkTransactionLimits(address account, uint256 amount) external returns (bool);
    function updateTransactionRecord(address account, uint256 amount) external;
    function emergencyStop() external;
    function emergencyResume() external;
    function changeOwner(address newOwner) external;
    function addSupervisor(address supervisor) external;
    function removeSupervisor(address supervisor) external;
    function setTokenAddresses(address _baseToken, address _utilityToken) external;
}

contracts/SystemOrchestrator.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

/**
 * @title SystemOrchestrator
 * @author Quantum Development Team
 * @notice Simplified orchestrator for the Quantum Platform ecosystem
 * @dev This version focuses on coordination rather than deployment
 */
contract SystemOrchestrator {
    address public owner;
    
    struct PlatformAddresses {
        address platformCore;
        address gateway;
        address serviceManager;
        address assetManager;
        address stakeManager;
        address creatorTokenManager;
        address securityModule;
    }
    
    PlatformAddresses public platformAddresses;
    
    event PlatformConfigured(
        address indexed platformCore,
        address indexed gateway,
        address serviceManager,
        address assetManager,
        address stakeManager,
        address creatorTokenManager,
        address securityModule
    );
    
    constructor() {
        owner = msg.sender;
    }
    
    modifier onlyOwner() {
        require(msg.sender == owner, "SystemOrchestrator: caller is not owner");
        _;
    }
    
    function configurePlatform(
        address _platformCore,
        address _gateway,
        address _serviceManager,
        address _assetManager,
        address _stakeManager,
        address _creatorTokenManager,
        address _securityModule
    ) external onlyOwner {
        require(_platformCore != address(0), "Invalid platform core");
        require(_gateway != address(0), "Invalid gateway");
        
        platformAddresses = PlatformAddresses({
            platformCore: _platformCore,
            gateway: _gateway,
            serviceManager: _serviceManager,
            assetManager: _assetManager,
            stakeManager: _stakeManager,
            creatorTokenManager: _creatorTokenManager,
            securityModule: _securityModule
        });
        
        emit PlatformConfigured(
            _platformCore,
            _gateway,
            _serviceManager,
            _assetManager,
            _stakeManager,
            _creatorTokenManager,
            _securityModule
        );
    }
    
    function getPlatformAddresses() external view returns (PlatformAddresses memory) {
        return platformAddresses;
    }
}

